We are very happy to announce the addition of @eddy_arg to the Atlanta Tattoo Expo.  Eddy tattoos out of @diligentlobotomytattoo in Tucker, GA.  Eddy is an amazing, award winning tattooist, so be sure to give him a follow and check out all of his beautiful work.  He will be tattooing with us all weekend long, Jan 26th-28th, 2024.  Join us for all the fun!  We will have celebrities, tattoo contests, costume contests, entertainment, panels, film festival, and tattooing all weekend long!!! 

